import React from 'react'
import { Nav } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import './Checkoutsteps.css'
function Checkoutsteps(props) {
    return (
        <Nav className='justify-content-center mb-4'>
            <Nav.Item>
                {props.step1 ? (<Nav.Link>
                    <Link to='/' style={{textDecoration:"none"}}>
                        <b>Home</b><span><svg xmlns="http://www.w3.org/2000/svg" x="0" y="0" width="20" height="20" viewBox="0 0 48 48">
<path fill="#43A047" d="M40.6 12.1L17 35.7 7.4 26.1 4.6 29 17 41.3 43.4 14.9z"></path>
</svg></span>
                    </Link></Nav.Link>
                ) : (
                        <Nav.Link disabled>Home</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {props.step2 ? (<Nav.Link>
                    <Link to='/shipping' style={{textDecoration:"none"}}>
                        Address
                    </Link></Nav.Link>
                ) : (
                        <Nav.Link disabled>Address</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {props.step3 ? (<Nav.Link>
                    <Link to='/payment' style={{textDecoration:"none"}}>
                        Payment
                    </Link></Nav.Link>
                ) : (
                        <Nav.Link disabled>Payment</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {props.step4 ? (<Nav.Link>
                    <Link to='/placeorder' style={{textDecoration:"none"}}>
                        Place Order
                    </Link></Nav.Link>
                ) : (
                        <Nav.Link disabled>Place Order</Nav.Link>
                    )}
            </Nav.Item>
        </Nav>
    )
}

export default Checkoutsteps
